import Header from "./components/header/header";
import Home from "./views/home/home";
import {Route, Router, Switch} from 'react-router-dom'

function App() {
  return (
    <Router>
      <Header />
      <Switch>
        <Route></Route>
      </Switch>
      <Home></Home>
      <div>Footer</div>
    </Router>
  );
}

export default App;
